Alice = rsa.RSA_PKC('tudoigual/keys')
Bob   = rsa.RSA_PKC('tudoigual/keys/Bob')

def testSignVerify():
  message = 'blah blah blah'.encode()
  for hashmod in (MD2,MD5,SHA,SHA224,SHA256,SHA384,SHA512,RIPEMD):
    h = hashmod.new()
    h.update(message)
    signature = Alice.sign(message = message, hash = hashmod)
    result = Bob.verify(public_key = Alice.pk, message = message, signature = signature, hash = hashmod)
    assert result == True

def test_pkcs_1_5__mod_1024__SignVerify():
  for i in range(len(pkcs_1_5__mod_1024__test_vectors)):
    row = pkcs_1_5__mod_1024__test_vectors[i]
    comps = [ int((row[0][x]),16) for x in ('n','e','d') ]
    key = RSA.construct(comps)
    Alice.sk = key
    Alice.pk = key.publickey()
    hashmod = row[3]
    message = a2b_hex(row[1])
    signature = Alice.sign(message = message, hash = hashmod)
    assert hexlify(signature).decode() == row[2]
    result = Bob.verify(public_key = Alice.pk, message = message, signature = signature, hash = hashmod)
    assert result == True


